import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './Login';
import Home from './Home';
import Navigation from './Navigation';
import About from './About';
import Products from './Products'; // Add the import statement for Products
import Contact from './Contact'; // Add the import statement for Contact

function App() {
  return (
    <Router>
      <div>
        <Navigation />

        <Switch>
          <Route exact path="/" component={Login} />
          <Route path="/home" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/products" component={Products} /> {/* Add the Products route */}
          <Route path="/contact" component={Contact} /> {/* Add the Contact route */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
